using System;
using System.Net;
using System.Text;
using Models;
using Newtonsoft.Json;

namespace Notification.Helper
{
    public static class ImageUrlHelper
    {
        public static string GetAttachmentDetailsFromUrl(string url)
        {
            var attachment = new AttachmentQueue
            {
                ContentId = "property",
                Type = "image/jpeg",
                Disposition = "inline",
                FileName = "CashOffrs_Property.jpg",
                Content = ""
            };
            if (string.IsNullOrEmpty(url)) return JsonConvert.SerializeObject(attachment);
            try
            {
                using (WebClient wc = new WebClient())
                {
                    var name = System.IO.Path.GetFileName(url);
                    var bytes = wc.DownloadData(url);
                    var mimeType = wc.ResponseHeaders["content-type"];

                    attachment.Type = mimeType;
                    attachment.FileName = name;
                    attachment.Content = Convert.ToBase64String(bytes);
                }
            }
            catch (Exception e)
            {
                Console.WriteLine(e);
            }

            return JsonConvert.SerializeObject(attachment);
        }

        public static string PrepareAdsFile(string adsContent)
        {
            byte[] bytes = Encoding.ASCII.GetBytes(adsContent);
            var str = Convert.ToBase64String(bytes);
            var attachment = new AttachmentQueue
            {
                ContentId = "ads",
                Type = "text/plain",
                Disposition = "inline",
                FileName = "Ads.txt",
                Content = str
            };

            return JsonConvert.SerializeObject(attachment);
        }
    }
}
